import { Routes,Route } from "react-router-dom"
import Acompañante from "../Pages/Acompañante"
import Main from "../Components/Main"


const Index = () => {
  return (
    
    <Routes>
        <Route path='/Acompañante' element = {<Acompañante/>} />
        <Route path='/' element = {<Main/>} />
        
    </Routes>

  )
}

export default Index
